Rules.InvariantScript:
If(
    (Self.Text <> "" And Value(Self.Text) <> RoundDown(
        Value(Self.Text),
        0
    ) Or Value(Self.Text) < 1) And !IsBlank(Value(Self.Text)),
    Notify(
        "Please enter whole number",
        NotificationType.Information,
        1000
    );
    Reset(Self),
    If(
        (Value(Self.Text) = 0 Or IsBlank(Self.Text)) && (LookUp(
            colReasonsVisits,
            id = ThisItem.'SKU Master'
        ).qtyPcs = 0 Or IsBlank(
            LookUp(
                colReasonsVisits,
                id = ThisItem.'SKU Master'
            ).qtyPcs
        )),
        Remove(
            colReasonsVisits,
            LookUp(
                colReasonsVisits,
                id = ThisItem.'SKU Master'
            )
        ),
        If(
            IsBlank(
                LookUp(
                    colReasonsVisits,
                    id = ThisItem.'SKU Master'
                )
            ),
            Collect(
                colReasonsVisits,
                {
                    id: ThisItem.'SKU Master',
                    qtyCases: Value(Self.Text)
                }
            ),
            Patch(
                colReasonsVisits,
                LookUp(
                    colReasonsVisits,
                    id = ThisItem.'SKU Master'
                ),
                {qtyCases: Value(Self.Text)}
            )
        )
    )
)

